import React from "react";

export default function LandingPage() {
    return (
        <div className="landing-page container">
            <div className="headline">
                <h1>MARS <br></br> TRAVELING</h1>
                <p>Make your dream come true.</p>
            </div>
            <div className="year">
                2016
            </div>
        </div>
    )
}
